.tooltip:after {
    background: rgba(48,55,66,.95);
    border-radius: .1rem;
    bottom: 100%;
    color: #fff;
    content: attr(data-tooltip);
    display: block;
    font-size: .7rem;
    left: 50%;
    max-width: 320px;
    opacity: 0;
    overflow: hidden;
    padding: .2rem .4rem;
    pointer-events: none;
    position: absolute;
    text-overflow: ellipsis;
    transform: translate(-50%,.4rem);
    transition: opacity .2s,transform .2s;
    white-space: pre;
    z-index: 300
}

.tooltip:focus:after,.tooltip:hover:after {
    opacity: 1;
    transform: translate(-50%,-.2rem)
}

