*,*:before,*:after {
    box-sizing: border-box
}

:focus {
    outline: 0
}

html {
    scroll-behavior: smooth
}

body {
    margin: 0;
    background: #f7f9fb;
    font-size: 14px;
    overscroll-behavior-x: none!important
}

#app {
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
    height: 100vh
}

:root {
    --el-color-semi-white: #f7f8fa;
    --el-color-f-one: #f1f1f1;
    --el-color-f-nine: #f1f1f1;
    --el-color-four: #444;
    --el-color-seven-three: #737373;
    --el-color-nine: #999;
    --el-color-e-five: #e5e5e5;
    --el-color-five: #555;
    --el-fill-color-light: #ededed;
    --el-popover-padding: 5px
}

.el-button--small {
    --el-button-size: calc(var(--el-input-height, 24px) - 2px)
}

.el-select-v2--small .el-select-v2__wrapper .el-select-v2__combobox-input {
    height: 14px
}

.el-input-number--small {
    line-height: 20px
}

.el-tag--small {
    height: 18px
}

.el-popover.el-popper {
    text-align: initial
}

.el-input.el-input--small {
    line-height: var(--el-input-height-1)
}

body.dark {
    color: #fff;
    --el-bg-primary: #222;
    --el-color-primary: #fff;
    --el-color-semi-white: #333;
    --el-text-color-primary: #fff;
    --el-card-border-color: #313131;
    --el-border-color-light: #313131;
    --el-color-f-one: #333;
    --el-color-four: #fff;
    --el-color-seven-three: #f1f1f1;
    --el-color-nine: #303030;
    --el-color-e-five: #4c4c4c;
    --el-color-five: #fff;
    --el-color-white: #333;
    --el-border-color-base: #333;
    --el-disabled-bg-color: #333;
    --el-text-color-regular: #fff;
    --el-color-black: #333;
    --el-bg-color: #222
}

body.dark .el-link {
    --el-link-default-text-color: #fff
}

body.dark .el-bg-grey {
    background: #222;
    color: #fff
}

body.dark .el-dropdown-menu,body.dark .el-dropdown__popper.el-popper[role=tooltip] {
    background: #333
}

body.dark .el-card__header {
    background: #222
}

body.dark .control-secondary {
    background: var(--el-color-black);
    border: 1px solid var(--el-color-black)
}

body.dark .el-input__inner {
    border-color: #333
}

body.dark .el-hover:hover {
    background: #333!important
}

body.dark .el-pagination.is-background .el-pager li:not(.disabled).active {
    --el-color-primary: #333;
    --el-color-white: #fff
}

body.dark .el-pagination.is-background .btn-next,body.dark .el-pagination.is-background .btn-prev,body.dark .el-pagination.is-background .el-pager li {
    background-color: #333;
    --el-text-color-regular: #fff
}

.el-main {
    background: var(--el-bg-primary);
    height: calc(100vh - 50px);
    overflow: auto;
    padding: 0
}

.wrapper {
    height: 100%;
    width: 100%
}

.cog-autocomplete {
    width: auto!important
}

.box {
    display: flex;
    flex-direction: column;
    height: 100%
}

.box .box-header.box-header-flex {
    display: flex;
    align-items: center;
    justify-content: space-between
}

.box .box-header {
    background: var(--el-color-nine);
    min-height: 40px
}

.box .box-header .box-list {
    display: flex;
    justify-content: space-around;
    align-items: center;
    height: 40px
}

.box .box-header .box-item {
    display: flex;
    align-items: center;
    justify-content: center;
    height: 100%;
    flex: 1;
    border-bottom: 3px solid transparent;
    cursor: pointer
}

.box .box-header .box-item i {
    font-size: 18px
}

.box .box-header .box-active {
    border-bottom: 3px solid var(--el-color-seven-three)
}

.box .box-header {
    color: #fff
}

.box .box-submenu {
    display: flex;
    justify-content: space-around;
    align-items: center;
    min-height: 15px
}

.box .box-submenu .box-submenu-item {
    flex: 1
}

.box .box-subheader {
    display: flex;
    justify-content: space-around;
    align-items: center;
    min-height: 30px;
    padding: 0
}

.box .box-subheader .box-subheader-title {
    font-weight: 700
}

.box .box-subheader .box-subheader-title,.box .box-subheader .box-subheader-actions i {
    color: var(--el-color-seven-three);
    flex: 1;
    font-size: 16px
}

.box .box-subheader .box-subheader-actions {
    display: flex;
    justify-content: end;
    align-items: center
}

.box .box-body {
    flex-grow: 1;
    background: var(--el-color-f-one);
    padding: 5px 10px;
    overflow: auto
}

.box .box-body-light {
    background: #fff
}

.box .box-body.body-overflow {
    overflow: auto
}

.box-gray {
    background: #E7E7E7;
    color: #444
}

.box-gray .box-header,.box-gray .box-header {
    color: #444
}

.box-gray .splitpanes__pane,.box-gray .splitpanes.default-theme.splitpanes-border .splitpanes__splitter {
    background-color: transparent!important
}

.box-gray .el-collapse.collapse-clean {
    border: 0
}

.el-button-gray {
    background: #666;
    border-color: #555
}

.el-button-gray:hover,.el-button-gray:active,.el-button-gray:focus {
    background: #555
}

.collapse-clean.el-collapse {
    --el-collapse-border-color: var(--el-border-color-lighter) !important;
    --el-collapse-header-height: 48px;
    --el-collapse-header-background-color: transparent;
    --el-collapse-header-font-color: var(--el-color-primary) !important;
    --el-collapse-header-font-size: 14px;
    --el-collapse-header-text-color: var(--el-color-primary) !important;
    --el-collapse-content-background-color: tranparent;
    --el-collapse-content-font-size: 14px;
    --el-collapse-content-font-color: var(--el-color-primary) !important
}

.collapse-clean.el-collapse .el-collapse-item__content {
    color: #444
}

.text-right {
    text-align: right
}

.el-close-button {
    margin-left: 10px;
    padding: 0 5px!important;
    font-size: 12px;
    border-radius: 2px;
    cursor: pointer;
    display: inline-flex;
    justify-content: center;
    align-items: center;
    color: #fff;
    background: var(--el-color-danger);
    border-color: var(--el-color-danger);
    height: 24px;
    max-height: 24px!important;
    min-height: 24px!important
}

