html,body,#app,span {
    font-family: Quicksand,ui-sans-serif,system-ui,-apple-system,BlinkMacSystemFont,Segoe UI,Roboto,Helvetica Neue,Arial,Noto Sans,sans-serif,"Apple Color Emoji","Segoe UI Emoji",Segoe UI Symbol,"Noto Color Emoji"!important
}

.fill-primary {
    fill: var(--el-color-primary)
}

.fill-white {
    fill: #fff
}

:root {
    --el-border-radius-base: 3px
}

.spot {
    position: absolute;
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
    z-index: 100;
    background: rgba(225,225,225,.4)
}

.spot .el-input__inner:focus {
    border-color: #fff!important
}

.spot .el-icon-close.el-input__icon.el-cursor {
    font-weight: 700;
    color: var(--el-color-primary)
}

.spot .spotlight {
    background: #fafafa;
    position: fixed;
    top: 15%;
    left: 50%;
    width: 98%;
    max-width: 540px;
    transform: translate(-50%);
    transition: top .3s ease-in-out;
    border-radius: 4px;
    overflow: hidden;
    font-family: font-family: Quicksand,ui-sans-serif,system-ui,-apple-system,BlinkMacSystemFont,Segoe UI,Roboto,Helvetica Neue,Arial,Noto Sans,sans-serif,"Apple Color Emoji","Segoe UI Emoji",Segoe UI Symbol,"Noto Color Emoji";
    border: 1px solid var(--el-color-primary);
    -webkit-box-shadow: 0 0 0 1px rgba(16,22,26,.1),0 4px 8px rgba(16,22,26,.2),0 18px 46px 6px rgba(16,22,26,.2);
    box-shadow: 0 0 0 1px #10161a1a,0 4px 8px #10161a33,0 18px 46px 6px #10161a33
}

.bg-white {
    background-color: #fff!important
}

.fade-enter-active,.fade-leave-active {
    transition: opacity .3s ease
}

.fade-enter-from,.fade-leave-to {
    opacity: 0
}

.splitpanes {
    display: flex;
    width: 100%;
    height: 100%
}

.splitpanes--vertical {
    flex-direction: row
}

.splitpanes--horizontal {
    flex-direction: column
}

.splitpanes--dragging * {
    user-select: none
}

.splitpanes__pane {
    width: 100%;
    height: 100%;
    overflow: hidden
}

.splitpanes--vertical .splitpanes__pane {
    transition: width .2s ease-out
}

.splitpanes--horizontal .splitpanes__pane {
    transition: height .2s ease-out
}

.splitpanes--dragging .splitpanes__pane {
    transition: none
}

.splitpanes__splitter {
    touch-action: none
}

.splitpanes--vertical>.splitpanes__splitter {
    min-width: 1px;
    cursor: col-resize
}

.splitpanes--horizontal>.splitpanes__splitter {
    min-height: 1px;
    cursor: row-resize
}

.splitpanes.default-theme .splitpanes__pane {
    background-color: #f2f2f2
}

.splitpanes.default-theme .splitpanes__splitter {
    background-color: #fff;
    box-sizing: border-box;
    position: relative;
